function osyRepair(){	
	global $db;
	global $mod_strings,$current_user;
	$current_user->retrieve('1');
	
	if(empty($_SESSION['authenticated_user_language'])) {
		$current_language = $sugar_config['default_language'];
	} else {
		$current_language = $_SESSION['authenticated_user_language'];
	}
	
	$mod_strings=return_module_language($current_language , 'Administration');
// 	function replace_br($buffer){
	
// 		$buffer = str_replace("<br>","\n",$buffer);
// 		$buffer = str_replace("<BR>","\n",$buffer);
// 		$buffer = str_replace("<BR/>","\n",$buffer);
// 		$buffer = str_replace("<br/>","\n",$buffer);
// 		return $buffer;
// 	}
	
	//ob_start("replace_br");
	
	$selectedActions = array(			
			'rebuildExtensions',
			'clearTpls',
			'clearJsFiles',
			'clearDashlets',
			'clearVardefs',
			'clearJsLangFiles',
			'rebuildAuditTables',
			'repairDatabase',
	);
	
	$installed_modules=array($mod_strings['LBL_ALL_MODULES']);
	require_once('include/SugarObjects/VardefManager.php');
	require_once('modules/Administration/QuickRepairAndRebuild.php');
	
	$_REQUEST['osy_repair_silent']="";
	$_REQUEST['module']="Administration";
	$_REQUEST['action']="";
	$_REQUEST['currentmodule']="Administration";
		
	VardefManager::clearVardef();
	$rac = new RepairAndClear();
	$rac->repairAndClearAll($selectedActions, $installed_modules, true, false);
	//ob_start("replace_br");
}

